s:\n\n    - AFINN\n    - bing\n    - loughran\n\n- These three lexicons make use of the unigrams. Unigrams are a type of n-gram model that consists of a sequence of 1 item, that is, a word collected from a given textual data.\n\n- In the AFINN lexicon model scores the words in a range from -5 to 5. The increase in negativity corresponds the negative sentiment whereas an increase in positivity corresponds the positive one. \n- The bing lexicon model on the other hand, classifies the sentiment into a binary category of negative or positive. \n- The loughran model that performs analysis of the shareholder’s reports. In this project, we will make use of the bing lexicons to extract the sentiments out of our data. \n\n#### Reference: [ScienceDirect](https://www.sciencedirect.com/science/article/abs/pii/S095741741830143X)","metadata":{}},{"cell_type":"markdown","source":"# Sentiments","metadata":{}},{"cell_type":"markdown","source":"## We can retrieve these lexicons using the get_sentiments() function. We can implement this as follows:","metadata":{}},{"cell_type":"code","source":"get_sentiments(\"bing\")","metadata":{"execution":{"iopub.status.busy":"2024-05-20T11:28:04.634043Z","iopub.execute_input":"2024-05-20T11:28:04.63572Z","iopub.status.idle":"2024-05-20T11:28:04.702037Z"},"trusted":true},"execution_count":4,"outputs":[{"output_type":"display_data","data":{"text/html":"<table class=\"dataframe\">\n<caption>A tibble: 6786 × 2</caption>\n<thead>\n\t<tr><th scope=col>word</th><th scope=col>sentiment</th></tr>\n\t<tr><th scope=col>&lt;chr&gt;</th><th scope=col>&lt;chr&gt;</th></tr>\n</thead>\n<tbody>\n\t<tr><td>2-faces      </td><td>negative</td></tr>\n\t<tr><td>abnormal     </td><td>negative</td></tr>\n\t<tr><td>abolish      </td><td>negative</td></tr>\n\t<tr><td>abominable   </td><td>negative</td></tr>\n\t<tr><td>abominably   </td><td>negative</td></tr>\n\t<tr><td>abominate    </td><td>negative</td></tr>\n\t<tr><td>abomination  </td><td>negative</td></tr>\n\t<tr><td>