ize the words present in the book","metadata":{}},{"cell_type":"markdown","source":"### we will visualize the words present in the book “Emma” based on their corresponding positive and negative scores:","metadata":{}},{"cell_type":"code","source":"library(ggplot2)\nggplot(Emma_sentiment, aes(index, sentiment, fill = book)) +\n geom_bar(stat = \"identity\", show.legend = TRUE) +\n facet_wrap(~book, ncol = 2, scales = \"free_x\")","metadata":{"execution":{"iopub.status.busy":"2024-05-20T11:28:06.441268Z","iopub.execute_input":"2024-05-20T11:28:06.442664Z","iopub.status.idle":"2024-05-20T11:28:07.146383Z"},"trusted":true},"execution_count":9,"outputs":[{"output_type":"display_data","data":{"image/png":"iVBORw0KGgoAAAANSUhEUgAAA0gAAANICAIAAAByhViMAAAABmJLR0QA/wD/AP+gvaeTAAAg\nAElEQVR4nOzdd5hcVd0H8DNl+26ymw3SRUILVUEFUYqRoKKAIiAgLSAgGEAFQ5EYQ2jSEYUX\nxAK+AgFFXkGUqhAQFEUQsQCCFGmB1E3ZPu8fA8uyu9mdTGZ2Zs9+Po+Pz8y9d8793Zov5969\nN5HJZAIAACNfstQFAABQGIIdAEAkBDsAgEgIdgAAkRDsAAAiIdgBAERCsAMAiIRgBwAQiXSp\nCyiArq6uF154odRVAABvW3/99UtdwmgUQ7ALIXR0dJS6BACAEnMpFgAgEoIdAEAkBDsAgEgI\ndgAAkRDsAAAiIdgBAERCsAMAiEQkz7EDyscfp+59yj/m9x9+529/V5EY/nIARhHBDii86nEf\nP+ebu/UZmJbqAIpMsAMKL1Wx+vve975BJ+nq6k6lhrgZJJdpAHibYAcMq713nfypc078wznf\neWZBZ9OaG0355jkbPz/7rO/f9sqy5IYf2PXbM788NpXMZZoQQtuCv19+0fcfePSpRW2Z1dbd\n+NOHfv2gnd9d6uUDKCXBDii8ro65TzzxRO8hyfS4zSaulf38s2/eOHXmhdusnvr5Wad857gv\nNm8zecb5VyTmPjxt+vdm3fe5Cz+2Vo7TXHXcKXMaJp181tHjq7r+es8Vl59xzC7b37JmZWr4\nlxegTAh2QOG1zr/juOPu6D2kpnmvX//8+OznjY6dtcd264YQDv7qxF8e96dvn37U+tWpMGGv\n/Vf74W8fXxg+tlaO06yx+4HTPrnXhxqrQgjvXvug7/381KdbOwU7YDQT7IDCq1v94F/NPnxF\nY8dtMTb7IV1flax41/rVb0axsalEJpPJfZq9993zsQfnzH7uxVdeeeWZvz1UjAUBGFnclgyU\nVi5noQGm6eqYe+rBnz/9J/csTYzZavvJx50+veCVAYw4euyAEWnJC5c//Frbz+88e1wqGUJo\nXXB3qSsCKD3BDii8/n88EUJo2njTtQt3A1zFmImZ7vtuvOeve229xhvPPX7d//wghPD8ywu7\nxqzuJjtg1BLsgMLr/8cTIYTdfnrrSWvXF2oWtavtf96XXr30B6ffvCy1wcRtppx+9bizD7/m\n2MO2u/XWjWtEO2CUevs25JGrq6vrmWeeKXUVAMDbNt5441KXMBr54wkAgEgIdgAAkRDsAAAi\nIdgBAERCsAMAiIRgBwAQCcEOACASgh0AQ